import React from 'react';
import CloseIcon from '@mui/icons-material/Close';

const Navbar = () => {
  return (
    <nav style= {{display: "flex", justifyContent:"space-between"}}>
        <div>
          Your Notes
        </div>
        <div>
          <CloseIcon />
        </div>
    </nav>
  );
};

export default Navbar;
